DROP PROCEDURE IF EXISTS `SP_Ajout_Client`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_Ajout_Client` (IN `v_civ_id` INT(1), IN `v_nom` VARCHAR(25), IN `v_prenom` VARCHAR(25), IN `v_date_naissance` DATE, IN `v_mail` VARCHAR(40), IN `v_mdp` VARCHAR(25), IN `v_stat_id` INT(11), IN `v_adresse_l1` VARCHAR(50), IN `v_adresse_l2` VARCHAR(50), IN `v_adresse_l3` VARCHAR(50), IN `v_cp_ville` VARCHAR(50), IN `v_cp_code` VARCHAR(10))  BEGIN
