DROP PROCEDURE IF EXISTS `SP_Liste_Client`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_Liste_Client` ()  begin         select cli_civ_denomination, cli_date_naissance, cl.cli_id, cli_mail, cli_mdp,cli_nom, cli_permis_numero, cli_prenom,sc.cli_stat_id,cli_stat_libelle, adresse_l1, adresse_l2, adresse_l3, cp_codepostal, cp_ville,date_permis, typepermis_id          from civilite ci RIGHT join client cl on cl.cli_civ_id=ci.cli_civ_id          left join statut_client sc on cl.cli_stat_id=sc.cli_stat_id          left join adresse a on cl.cli_id=a.cli_id             left join cpville cp on cp.cp_id=a.cp_id         left join detenir d on cl.cli_id=d.cli_id         where sc.cli_stat_id<=2 or sc.cli_stat_id=5         ; end$$

DROP PROCEDURE IF EXISTS `SP_Liste_Vehicule`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_Liste_Vehicule` ()  begin
	select v.veh_id, v.veh_date_achat, v.veh_photo, v.veh_nb_place,
	v.veh_assur, v.veh_date_mec, v.veh_kmage, v.veh_ch_fisc,
	v.veh_ch_reel, v.veh_cyl, type_veh_libelle, type_veh_prix, cat_libelle,
	veh_boite_libelle, vehm_carb_libelle, veh_coul_libelle, vehmmod_libelle, vehmar_libelle,
	veh_porte_libelle, perm.typepermis_id, perm.typepermis_libelle
	from vehicule as v
	LEFT join type_permis as perm
	on v.typepermis_id = perm.typepermis_id
	LEFT join veh_type_carburant as carb
	on v.vehm_carb_id = carb.vehm_carb_id
	LEFT join veh_boite as boite
	on v.veh_boite_id = boite.veh_boite_id
	LEFT join veh_porte as porte
	on porte.veh_porte_id = v.veh_porte_id
	LEFT join type_veh as type
	on type.type_veh_id = v.type_veh_id
	LEFT join categorie_veh as cat
	on cat.cat_id = type.cat_id
	LEFT join veh_couleur as coul
	on coul.veh_coul_id = v.veh_coul_id
	LEFT join vehm_modele as modele
	on modele.vehmmod_id = v.vehmmod_id
	LEFT join vehm_marque as marque
	on marque.vehmar_id = modele.vehmar_id;
end$$

DROP PROCEDURE IF EXISTS `SP_Liste_Vehicule_Dispo`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_Liste_Vehicule_Dispo` (IN `v_cat_libelle` VARCHAR(50), IN `v_contrat_date_fin` DATE)  begin
	select DISTINCT v.veh_id, v.veh_photo, v.veh_nb_place, type_veh_libelle, type_veh_prix, cat_libelle,
	veh_boite_libelle, vehm_carb_libelle, vehmmod_libelle, vehmar_libelle,
	veh_porte_libelle,option_veh_libelle
	from statut_entretien as s 
	inner join entretien as e on s.statut_entretien_id = e.statut_entretien_id
	left join vehicule as v on e.veh_id=v.veh_id
	LEFT join veh_type_carburant as carb
	on v.vehm_carb_id = carb.vehm_carb_id
	LEFT join veh_boite as boite
	on v.veh_boite_id = boite.veh_boite_id
	LEFT join veh_porte as porte
	on porte.veh_porte_id = v.veh_porte_id
	LEFT join type_veh as type
	on type.type_veh_id = v.type_veh_id
	LEFT join categorie_veh as cat
	on cat.cat_id = type.cat_id
	
	LEFT join vehm_modele as modele
	on modele.vehmmod_id = v.vehmmod_id
	LEFT join vehm_marque as marque
	on marque.vehmar_id = modele.vehmar_id
	left join disposer as dispo
	on dispo.veh_id=v.veh_id
	left join option_veh as op on op.option_veh_id=dispo.option_veh_id
	where s.statut_entretien_id = 1  and cat_libelle=v_cat_libelle
and v.veh_id !=(select c.veh_id from contratdelocation c where contrat_date_fin >= v_contrat_date_fin );
end$$

